library("rzmq");
library("rjson");
if(!exists("JSONRPC.Protocol", mode="function")) source("jsonrpc.r");


##########################################################################################################
# Prueba 1: (CompareTwo) Comparar dos distribuciones, a ver si una es mas grande que la otra.
##########################################################################################################
prueba_1 <- function(stats_socket,msg_compare_two){
     cat("Executing Test 1...\n");
    #cat(msg_compare_two,"\n");
	send.raw.string(stats_socket, msg_compare_two);
	result = receive.string(stats_socket);
	result <- fromJSON(result);
	print(result);
}


##########################################################################################################
# Prueba 2: (Basic Stats) Obtengo las estadisticas basicas de una distribucion
##########################################################################################################
prueba_2 <- function(stats_socket,datos_distribucion,id_service){
	 cat("Executing Test 2...\n");
	params <- list();
	params[[1]] <- datos_distribucion;
	msg_basic_stats <- JSONRPC.Request("basicStats",params,id_service);
	#cat(msg_basic_stats,"\n");
	send.raw.string(stats_socket, msg_basic_stats);
	result = receive.string(stats_socket);
	result <- fromJSON(result);
	print(result);
}

##########################################################################################################
# Prueba 3: (Distribution of) Obtengo la lista de las distribuciones que se aceptan
##########################################################################################################
prueba_3 <- function(stats_socket,datos_distribucion,id_service){
	 cat("Executing Test 3...\n");
	params <- list();
	params[[1]] <- datos_distribucion;
	msg_distribution_of <- JSONRPC.Request("distributionOf",params,id_service);
	#cat(msg_distribution_of,"\n");
	send.raw.string(stats_socket, msg_distribution_of);
	result = receive.string(stats_socket);
	distribuciones <- fromJSON(result);
	distribuciones <- distribuciones$result$dist;
	print(distribuciones);
	return(distribuciones);
}

##########################################################################################################
# Prueba 4: (getInfoDistribution) Con respecto a cada distribucion dicha antes, presento los parametros
##########################################################################################################
prueba_4 <- function(stats_socket,datos_distribucion,distribuciones,id_service){
	 cat("Executing Test 4...\n");
	 for (i in 1:length(distribuciones)){
	     params <- list();
	    params[[1]] <- datos_distribucion;
	    params[[2]] <- distribuciones[i];
	    msg_getInfoDistribution <- JSONRPC.Request("getInfoDistribution",params,id_service);
	    #cat(msg_getInfoDistribution,"\n");
	    send.raw.string(stats_socket, msg_getInfoDistribution);
	    result = receive.string(stats_socket);
	    result <- fromJSON(result);
	    cat("Info del ajuste a la distribucion",distribuciones[i],":\n");
	    print(result$result$estimate);
	    print(result$result$ks.value);
	    print(result$result$ks.test);
	}
}

