##########################################################################################################
# Prueba 9: Comparando DOS muestras (TODOS los casos)
##########################################################################################################
prueba_9 <- function(stats_socket,datos_distribucion){
	 cat("Executing Test 9...\n");
	params <- list();
	datos_aux <- datos_distribucion / 2;
	params[[1]] <- list(datos_distribucion,datos_aux);
	params[[2]] <- "i";
	params[[3]] <- "two.sided";
	cat("Compare TWO Parametric Independent Two Sided\n");
	msg <- JSONRPC.Request("compare",params,id_service);
	#cat(msg,"\n");
	send.raw.string(stats_socket, msg);
	result = receive.string(stats_socket);
	cat(result,"\n");
	params[[3]] <- "greater";
	cat("Compare TWO Parametric Independent Greater\n");
	msg <- JSONRPC.Request("compare",params,id_service);
	#cat(msg,"\n");
	send.raw.string(stats_socket, msg);
	result = receive.string(stats_socket);
	cat(result,"\n");
	params[[2]] <- "d";
	params[[3]] <- "two.sided";
	cat("Compare TWO Parametric Dependent Two Sided\n");
	msg <- JSONRPC.Request("compare",params,id_service);
	#cat(msg,"\n");
	send.raw.string(stats_socket, msg);
	result = receive.string(stats_socket);
	cat(result,"\n");
	params <- list();
	datos_1 <- runif(10,1.0,10.0);
	datos_2 <- rep(1:10);
	params[[1]] <- list(datos_1,datos_2);
	params[[2]] <- "i";
	params[[3]] <- "two.sided";
	cat("Compare TWO Non Parametric Independent Two Sided\n");
	msg <- JSONRPC.Request("compare",params,id_service);
	#cat(msg,"\n");
	send.raw.string(stats_socket, msg);
	result = receive.string(stats_socket);
	cat(result,"\n");
	params[[3]] <- "less";
	cat("Compare TWO Non Parametric Independent Less\n");
	msg <- JSONRPC.Request("compare",params,id_service);
	#cat(msg,"\n");
	send.raw.string(stats_socket, msg);
	result = receive.string(stats_socket);
	cat(result,"\n");
	params[[2]] <- "d";
	params[[3]] <- "two.sided";
	cat("Compare TWO Non Parametric Dependent Two Sided\n");
	msg <- JSONRPC.Request("compare",params,id_service);
	#cat(msg,"\n");
	send.raw.string(stats_socket, msg);
	result = receive.string(stats_socket);
	cat(result,"\n");
}

	
